import { useState, useEffect, useRef } from 'react';
import React from 'react';
import logo from './logo.svg';
import './App.css';
import styles from './styles.module.css';
import { useTransition, useSpring, config, useSpringRef, useChain, animated } from 'react-spring';
import {Parralax, ParallaxLayer } from '@react-spring/web';
import useMeasure from 'react-use-measure'
import { useDrag } from 'react-use-gesture'
import clamp from 'lodash.clamp'
import { useSprings} from '@react-spring/web'
import { addPropertyControls, ControlType } from 'framer';
import { motion } from 'framer-motion';

addPropertyControls(Nya, {
  text: {
      title: "Text",
      type: ControlType.String,
  },
  onTap: {
      type: ControlType.EventHandler,
  },
})

const containerStyle = {
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  overflow: "hidden",
}

const squareStyle = {
  margin: 50,
  padding: 50,
  color: "white",
  fontWeight: 600,
  borderRadius: 25,
  backgroundColor: "#09F",
  width: "max-content",
  whiteSpace: "pre-wrap",
  flexShrink: 0,
}

function SomeOtherFunction() {
  const [name, setName] = useState("world");
  useEffect(()=>{
    setName(prompt("What is your name?"))
  }, [])
  return(<h1>Hello, {name}</h1>)
}

function Example() {
  const [count, setCount] = useState(0);
  return (
    <div> 
      <h1>You clicked {count} times</h1>

      <button onClick={() => setCount(count + 1 )}>
        Click Me
      </button>
    </div>
  );
}

function App() {
  const { text, onTap, style } = props
  return (

    <div> 
       <motion.div style={{ ...style, ...containerStyle }}>
            <motion.div
                style={squareStyle}
                onTap={onTap}
                whileTap={{
                    scale: 1.25,
                    rotate: 90,
                    backgroundColor: "#07F",
                }}
            >
                {text}
            </motion.div>
        </motion.div>
      hi
    </div>
  );
}

export default App;
